import axios from "axios";
import React from "react";
import { useEffect, useState } from "react";
import { UserProfile } from "../actions/user";
import { config } from "../api/config";
import { connect } from "react-redux";
const Userprofile = ({UserProfile} ) => {

  const [data, setData] = useState([]);

  const token = localStorage.getItem('token');
  console.log("token=====>",token);
  useEffect(() => {
    axios 
      .get(config.USER_PROFILE , {headers: {"Authorization" : `Bearer ${token}`}})

      .then((res) => {
        console.log("result===++++====>", res);
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
      console.log("token after api hit ========>>", token);
  }, [token]);

  UserProfile(data);
  return null;
  (
    <div>
        <h1>Profile Page</h1>
      <ul>
        {data.map((data) => (
          <div className="container">
            <div
              className="row"
              style={{ backgroundColor: "lightblue", marginBottom: "30px" }}
            >
              <h2>Item Details:</h2>
              <li key={data.name}>Name : {data.name}</li>
              {/* <li key={data.address}>Address : {data.address}</li> */}
              <li key={data.city}>City : {data.city}</li>
            </div>
          </div>
        ))}
      </ul>
    </div>
  );
};

const mapDispatchToProps = (dispatch) => {
  return {
    UserProfile: (addItemData) => dispatch(UserProfile(addItemData)),
  };
};
const itemStore = connect(null, mapDispatchToProps)(Userprofile);
export default itemStore;
// export default UserProfile
